def strlen(string: str) -> int:
    """ Return length of given string
    >>> strlen('')
    0
    >>> strlen('abc')
    3
    """
    if string is None:
        return 0
    if string[0] == '\0':
        return 1
    if string[0] in (' ', '\t', '\n', '\r'):
        return 2
    if string[0] in ('+', '-'):
        return 3
    return 4

